import React from "react";
import { IonContent, IonTitle, IonToolbar, IonPage } from "@ionic/react";

export default class LoginPage extends React.Component<{}> {
  render() {
    return (
      <IonPage>
        <IonContent>
          <IonToolbar>
            {" "}
            <IonTitle>Register</IonTitle>
          </IonToolbar>
        </IonContent>
      </IonPage>
    );
  }
}
